import React, { Component } from 'react';
import { Container } from 'react-bootstrap';
import AddQuiz from './AddQuiz';
import GiveQuiz from './GiveQuiz';
class Quiz extends Component {
    
    render() {
        
        return (
            <Container>
                <br/>
                <br/>
                <br/>
                <center><h2>Quiz</h2></center>
                <br />

                <React.Fragment>
                    <AddQuiz />
                    <GiveQuiz />
                </React.Fragment>
            </Container>
        );
    }
}

export default Quiz;
